Diagnosis.
Intermediate gills. Shield (
Fig. 24a
) as broad as long; dorsal surface weakly calcified medially, and with low blister-like tubercles; rostrum broadly rounded, with short mid-dorsal ridge; anterior margins weakly concave; lateral projections subtriangular, with terminal spine; posterior margin broadly rounded. Ocular peduncles more than half length of shield, with dorsal longitudinal row of setae. Cornea slightly dilated. Ocular acicles subtriangular, terminating in strong spine usually directed anteromesially. Sternite of 3rd maxillipeds with small spine on each side of midline. Epistome with strong, straight spine. Antennular peduncle long, slender, exceeding distal margin of corneae by nearly entire length of ultimate segment. Antennal peduncle (
Fig. 24b
) exceeding distal margin of cornea by at most 0.20 length of 5th segment; 3rd segment with strong ventromesial distal spine; acicles curved outward (in dorsal view), not exceeding distal margin of corneae, and armed mesially with 4 to 7 strong spines; flagellum long, reaching to or slightly exceeding extended right cheliped, articles with very short setae interspersed with long setae every 5 to 15 articles. Chelipeds markedly dissimilar, glabrous or at most with scattered short setae, carpi and chelae usually iridescent dorsally. Right cheliped (
Fig. l4d,e
) with small tubercles or spines on dorsal surfaces of carpus and chela (tubercles or spines decreasing in size and number with increased size of individuals); fingers curved ventromesially; palm with dorsolateral margin well delimited by row of blunt to sharp spines, mesial face rounded. Left cheliped (
Fig. 24c
) with dorsolateral face of carpus frequently weakly calcified; chela with dorsomesial row of few small spines; carpus with irregular row of small spines dorsally. Ambulatory legs (
Fig. 24
d-f) reaching to tip of right cheliped, unarmed except for dorsodistal spine on carpus; dactyls approximately 1.8 times as long as propodus, each with ventromesial row of about 8 to 14 corneous spines. Anterior lobe of sternite of 3rd pereopods unarmed, or rarely with small blunt marginal spine. Fourth pereopod (

Fig. 
24g
,h

) with dactyl terminating in sharp corneous claw (longer and more slender in females than in males); propodal rasp consisting of 1 row of rounded scales. Uropods and telson markedly asymmetrical; telson (
Fig. 24k
) with weak transverse suture; dorsal surface usually with low, blister-like tubercles; posterior lobes separated by narrow cleft, terminal margin of lobes armed with numerous corneous spines (often strongly curved on left lobe). 
Male
1st gonopods (Fig. 241) each with concave distal lobe; 2nd gonopods (
Fig. 24j
) each with distal segment setose on distomesial face, and row of short bristle-like setae on lateral margin. Females occasionally with paired 1st pleopods; with vestigial 2nd right pleopod.
